function App() {
  return (
    <div className="App">
      <Nav/>
      <Router>
      <Routes>
        {/* <Route path="/" element={<Home />} /> */}
        <Route path="/login" element={<Login />} />
        <Route path="/price" element={<Price />} />
      </Routes>
    </Router>
      <Footer/>


    </div>
    // <Footer/>
  );
}

export default App;
